import { Component } from '@angular/core';

@Component({
  selector: 'app-timeslot',
  templateUrl:'./timeslot.component.html',
  styles: [
  ]
})
export class TimeslotComponent {
  block_A = [{ number: 'A_A1', occupied: false }, { number: 'A_A2', occupied: true }, { number: 'A_A3', occupied: false }, { number: 'A_A4', occupied: true }
            ,{ number: 'A_A5', occupied: false }, { number: 'A_A6', occupied: true }, { number: 'A_A7', occupied: false }, { number: 'A_A8', occupied: true }
            ];

}
